import React from 'react';
import { useParams } from 'react-router-dom';

function TourDetails() {
  const { id } = useParams();

  return (
    <div>
      <h2>Tour Details</h2>
      <p>Showing details for tour ID: {id}</p>
    </div>
  );
}

export default TourDetails;
